import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My React App</h1>
      </header>
      <main>
        <button onClick={() => alert('Button clicked!')}>
          Click Me!
        </button>
      </main>
    </div>
  );
}

export default App;
